"""
Entry point for the predictions jon
"""
from pyhocon import ConfigFactory
from src.utils.setup_logging import setup_logging
from src.utils.reader import read_csv
from transformations.text_processing import ProcessTextData
from pathlib import Path
import logging
import spacy
from spacy import displacy


logger = logging.getLogger(__name__)


if __name__ == '__main__':
    # Invoke the configuration file :
    config_file = Path(Path(__file__).parents[1], "local_development/conf.json")
    config = ConfigFactory.parse_file(config_file)

    # Setup logger
    setup_logging(config=config)

    # Load input data
    input_df = read_csv(input_path=config.tables.input.urls.path, file_separator=config.tables.input.urls.path)

    # Fetch 20 rows at random between min out of sample and max length
    input_df = input_df[config.n_urls_for_training:]
    # input_df = input_df.sample(20)

    # Transform text data
    urls = input_df["urls"].values.tolist()
    text_transformer = ProcessTextData(input_df=input_df)
    texts_df = text_transformer.run()
    texts_df = texts_df[texts_df["texts"] != 'no_text_returned']
    texts_df.to_csv(path_or_buf=Path(Path(__file__).parents[2], 'data/intermediate/predictions/texts.csv'), header=1,
                    index=None, sep=',', mode='w')

    # Load model :
    model_dir = str(Path(Path(__file__).parents[2], config.tables.output.model))
    logger.info(f"Loading model from {model_dir}")
    model = spacy.load(model_dir)

    # Predictions :
    output_l = []
    input_dict = dict(zip(texts_df["urls"], texts_df["texts"]))
    for url, text in input_dict.items():
        doc = model(text)
        logger.info(f"Entities : {[(ent.text, ent.label_) for ent in doc.ents]}")
        output_l.append([url, [(ent.text, ent.label_) for ent in doc.ents]])
    logger.info("Predictions done!")

    # Write predictions into txt file
    predictions_path = Path(Path(__file__).parents[2], 'data/output/predictions/initial_predictions.txt')
    with open(predictions_path, 'w') as fp:
        for item in output_l:
            # write each item on a new line
            fp.write("%s\n" % item)
        print('Done')

